public static PaymentDto map(final Payment payment) {
    return PaymentDto.builder().paymentId(payment.getPaymentId()).isPayed(payment.getIsPayed()).paymentStatus(payment.getPaymentStatus()).orderDto(OrderDto.builder().orderId(payment.getOrderId()).build()).build();
}

public static Payment map(final PaymentDto paymentDto) {
    return Payment.builder().paymentId(paymentDto.getPaymentId()).orderId(paymentDto.getOrderDto().getOrderId()).isPayed(paymentDto.getIsPayed()).paymentStatus(paymentDto.getPaymentStatus()).build();
}

@Override
public List<PaymentDto> findAll() {
    log.info("*** PaymentDto List, service; fetch all payments *");
    return this.paymentRepository.findAll().stream().map(PaymentMappingHelper::map).map(p -> {
        p.setOrderDto(this.restTemplate.getForObject(AppConstant.DiscoveredDomainsApi.ORDER_SERVICE_API_URL + "/" + p.getOrderDto().getOrderId(), OrderDto.class));
        return p;
    }).distinct().collect(Collectors.toUnmodifiableList());
}

@Override
public PaymentDto findById(final Integer paymentId) {
    log.info("*** PaymentDto, service; fetch payment by id *");
    return this.paymentRepository.findById(paymentId).map(PaymentMappingHelper::map).map(p -> {
        p.setOrderDto(this.restTemplate.getForObject(AppConstant.DiscoveredDomainsApi.ORDER_SERVICE_API_URL + "/" + p.getOrderDto().getOrderId(), OrderDto.class));
        return p;
    }).orElseThrow(() -> new PaymentNotFoundException(String.format("Payment with id: %d not found", paymentId)));
}

@Override
public PaymentDto save(final PaymentDto paymentDto) {
    log.info("*** PaymentDto, service; save payment *");
    return PaymentMappingHelper.map(this.paymentRepository.save(PaymentMappingHelper.map(paymentDto)));
}

@Override
public PaymentDto update(final PaymentDto paymentDto) {
    log.info("*** PaymentDto, service; update payment *");
    return PaymentMappingHelper.map(this.paymentRepository.save(PaymentMappingHelper.map(paymentDto)));
}

@Override
public void deleteById(final Integer paymentId) {
    log.info("*** Void, service; delete payment by id *");
    this.paymentRepository.deleteById(paymentId);
}

@Bean
public ObjectMapper objectMapperBean() {
    return new JsonMapper().enable(SerializationFeature.INDENT_OUTPUT);
}

@GetMapping
public ResponseEntity<DtoCollectionResponse<PaymentDto>> findAll() {
    log.info("*** PaymentDto List, controller; fetch all payments *");
    return ResponseEntity.ok(new DtoCollectionResponse<>(this.paymentService.findAll()));
}

@GetMapping("/{paymentId}")
public ResponseEntity<PaymentDto> findById(@PathVariable("paymentId") @NotBlank(message = "Input must not be blank") @Valid final String paymentId) {
    log.info("*** PaymentDto, resource; fetch payment by id *");
    return ResponseEntity.ok(this.paymentService.findById(Integer.parseInt(paymentId)));
}

@PostMapping
public ResponseEntity<PaymentDto> save(@RequestBody @NotNull(message = "Input must not be NULL") @Valid final PaymentDto paymentDto) {
    log.info("*** PaymentDto, resource; save payment *");
    return ResponseEntity.ok(this.paymentService.save(paymentDto));
}

@PutMapping
public ResponseEntity<PaymentDto> update(@RequestBody @NotNull(message = "Input must not be NULL") @Valid final PaymentDto paymentDto) {
    log.info("*** PaymentDto, resource; update payment *");
    return ResponseEntity.ok(this.paymentService.update(paymentDto));
}

@DeleteMapping("/{paymentId}")
public ResponseEntity<Boolean> deleteById(@PathVariable("paymentId") final String paymentId) {
    log.info("*** Boolean, resource; delete payment by id *");
    this.paymentService.deleteById(Integer.parseInt(paymentId));
    return ResponseEntity.ok(true);
}

@LoadBalanced
@Bean
public RestTemplate restTemplateBean() {
    return new RestTemplate();
}

public static void main(String[] args) {
    SpringApplication.run(PaymentServiceApplication.class, args);
}

@GetMapping
public String msg() {
    return "Payment controller responding!!";
}

@ExceptionHandler(value = { MethodArgumentNotValidException.class, HttpMessageNotReadableException.class })
public <T extends BindException> ResponseEntity<ExceptionMsg> handleValidationException(final T e) {
    log.info("**ApiExceptionHandler controller, handle validation exception*\n");
    final var badRequest = HttpStatus.BAD_REQUEST;
    return new ResponseEntity<>(ExceptionMsg.builder().msg("*" + e.getBindingResult().getFieldError().getDefaultMessage() + "!**").httpStatus(badRequest).timestamp(ZonedDateTime.now(ZoneId.systemDefault())).build(), badRequest);
}

@ExceptionHandler(value = { IllegalStateException.class, PaymentNotFoundException.class })
public <T extends RuntimeException> ResponseEntity<ExceptionMsg> handleApiRequestException(final T e) {
    log.info("**ApiExceptionHandler controller, handle API request*\n");
    final var badRequest = HttpStatus.BAD_REQUEST;
    return new ResponseEntity<>(ExceptionMsg.builder().msg("#### " + e.getMessage() + "! ####").httpStatus(badRequest).timestamp(ZonedDateTime.now(ZoneId.systemDefault())).build(), badRequest);
}
